/* Code from PBRT-v2. */
namespace PBRT
{
    constexpr float OneMinusEpsilon = 0.9999999403953552f;
    inline float VanDerCorput(uint32_t n, uint32_t scramble) {
        // Reverse bits of _n_
        n = (n << 16) | (n >> 16);
        n = ((n & 0x00ff00ff) << 8) | ((n & 0xff00ff00) >> 8);
        n = ((n & 0x0f0f0f0f) << 4) | ((n & 0xf0f0f0f0) >> 4);
        n = ((n & 0x33333333) << 2) | ((n & 0xcccccccc) >> 2);
        n = ((n & 0x55555555) << 1) | ((n & 0xaaaaaaaa) >> 1);
        n ^= scramble;
        return std::min(((n >> 8) & 0xffffff) / float(1 << 24), OneMinusEpsilon);
    }


    inline float Sobol2(uint32_t n, uint32_t scramble) {
        for (uint32_t v = 1 << 31; n != 0; n >>= 1, v ^= v >> 1)
            if (n & 0x1) scramble ^= v;
        return std::min(((scramble >> 8) & 0xffffff) / float(1 << 24), OneMinusEpsilon);
    }

    
    inline void Sample02(uint32_t n, const uint32_t scramble[2],
        float sample[2]) {
        sample[0] = VanDerCorput(n, scramble[0]);
        sample[1] = Sobol2(n, scramble[1]);
    }
}

struct PlasticBSDF
{
    static float GGX_D(const float3 &m)
    {
        float alphax = 0.01f;
        /*ensure the orientation is consistent with the macrosurface normal,
         *enabling us to leave out the heaviside function in D(m)*/
        if (m.z <= 0.f)
            return 0.f;

        float CosThetaSqr = m.z*m.z;
        float alphaSqr = alphax * alphax;
        float value = 0.f;

        float denom = (1 + TwUtil::BSDFMath::Tan2Theta(m) / alphaSqr);
        value = 1.f / (M_PI * alphaSqr * CosThetaSqr * CosThetaSqr * denom * denom);

        /*potential numeric issues preventing*/
        if (value * TwUtil::BSDFMath::CosTheta(m) < 1e-20f)
            value = 0.f;
        return value;
    }

    static float3 Eval_f(const float3 & wo_Local, const float3 & wi_Local)
    {
        /*one-sided BSDF detection*/
        if ((wo_Local).z <= 0.f || (wi_Local).z <= 0.f)
            return make_float3(0.f, 0.f, 0.f);

        auto pow5 = [](float v) { return (v * v) * (v * v) * v; };

        float3 Rs = make_float3(0.04f, 0.04f, 0.04f);
        float3 Rd = make_float3(1.f, 1.f, 1.f);

        auto SchlickFresnel = [pow5, &Rs](float cosTheta)
        {
            return Rs + pow5(1 - cosTheta) * (make_float3(1.f, 1.f, 1.f) - Rs);
        };

        float diffuseR = (28.f / (23.f * M_PI)) * Rd.x * (1.f - Rs.x) *
            (1 - pow5(1 - .5f * abs(wi_Local.z))) *
            (1 - pow5(1 - .5f * abs(wo_Local.z)));
        float3 wh = wi_Local + wo_Local;
        if (wh.x == 0 && wh.y == 0 && wh.z == 0)  return make_float3(0.f, 0.f, 0.f);
        wh = TwUtil::safe_normalize(wh);
        float specularR =
            GGX_D(wh) /
            (4 * fabsf(dot(wi_Local, wh)) * fmaxf(abs(wi_Local.z), abs(wo_Local.z))) *
            SchlickFresnel(dot(wi_Local, wh)).x;

        return make_float3(diffuseR + specularR, diffuseR + specularR, diffuseR + specularR);
    }
};

